import Fetch from 'node-fetch'

const mapAPIKey = "AIzaSyBlE7GymtUyLM97k2QlT1lPUJCYU_1GHd4" // TODO MOVE THIS TO SECRETS FILE
const geocodeAPIURL = "https://maps.googleapis.com/maps/api/geocode/json?"

export function getLatLng(address) {
    Fetch(geocodeAPIURL + "address=" + address.replace(" ", "+") + "&key=" + mapAPIKey)
    .then(res => res.json())
    .then(json => console.log(json))
    .catch(err => console.log(err));
}
